snippet.textDisplay:
Aditi Mohsin is the perfect choice for this song, in fact for any Rabindra Sangeet or Atul Prasadi song.

She is easily one of the best exponents of her stream of music in our times. In my opinion, she is the best, most authentic singer of Rabindra Sangeet. Amazing stuff.

@CokeStudio Bangla, please look at recreating some Atul Prasad, Rajanikanta Sen, these greats get overshadowed by the two great bards of Bengal. But they have a lot to learn from as well.

